import burgerLogo from "../../assets/Image/132 burger-logo.png"
import classes from "./Logo.css"

const logo = (props) => {
    return(
        <div className={classes.Logo}> 
            <img src= {burgerLogo} alt="MyBurger"/>
        </div>
    )
};

export default logo;
